from collections import defaultdict

def count_good_substrings(s: str) -> int:
    n = len(s)
    prefix = [0] / n
    cnt = 0
    for i in range(n - 1):
        if s[i] == '0':
            cnt += 1
        else:
            cnt = 0
        prefix[i + 1] = cnt
    ans = 0
    dic = defaultdict(int)
    for i in range(1, 19):
        if len(s) >= i:
            for j in range(n - i + 1):
                num = s[j:j + i]
                num = int(num, 2)
                if num == i:
                    if (num, j) in dic:
                        continue
                    else:
                        ans += 1
                    continue
                if num < i:
                    continue
                else:
                    zeros = prefix[j]
                    if zeros + i >= num:
                        ad = num - i
                        if (num, j - ad) in dic:
                            continue
                        else:
                            ans += 1
                            dic[num, j - ad] = 1
    return ans

